class OrderFactory(Factory):
    """Factory for generating order test data"""
    
    class Meta:
        model = OrderTestData
    
    user_id = LazyAttribute(lambda o: str(uuid.uuid4()))
    status = LazyAttribute(lambda o: random.choice([
        'pending', 'confirmed', 'processing', 'shipped', 'delivered', 'cancelled', 'refunded'
    ]))
    total_amount = LazyAttribute(lambda o: round(random.uniform(10.0, 1000.0), 2))
    currency = LazyAttribute(lambda o: random.choice(['USD', 'EUR', 'GBP', 'JPY']))
    payment_method = LazyAttribute(lambda o: random.choice([
        'credit_card', 'paypal', 'bank_transfer', 'crypto', 'cash_on_delivery'
    ]))
    payment_status = LazyAttribute(lambda o: random.choice([
        'pending', 'processing', 'completed', 'failed', 'refunded'
    ]))
    tracking_number = LazyAttribute(lambda o: fake.uuid4().hex[:12].upper())
    order_date = LazyAttribute(lambda o: fake.date_time_this_year())
    
    @classmethod
    def create_with_items(cls, num_items: int, **kwargs):
        """Create an order with specified number of items"""
        items = []
        product_factory = ProductFactory()
        
        for i in range(num_items):
            product = product_factory.create()
            items.append({
                'product_id': product.id,
                'product_name': product.name,
                'quantity': random.randint(1, 5),
                'unit_price': product.price,
                'total_price': product.price * random.randint(1, 5)
            })
        
        return cls.create(items=items, **kwargs)
    
    @classmethod
    def create_shipped(cls, **kwargs):
        """Create a shipped order"""
        shipped_date = fake.date_between(start_date='-30d', end_date='today')
        return cls.create(
            status='shipped',
            shipped_date=shipped_date,
            **kwargs
        )
    
    @classmethod
    def create_delivered(cls, **kwargs):
        """Create a delivered order"""
        delivered_date = fake.date_between(start_date='-10d', end_date='today')
        return cls.create(
            status='delivered',
            shipped_date=fake.date_between(start_date='-15d', end_date=delivered_date),
            delivered_date=delivered_date,
            **kwargs
        )

