class MockDataGenerator:
    """Generator for mock data in various formats"""
    
    @staticmethod
    def generate_jwt_token(payload: Dict[str, Any], secret: str = "test_secret") -> str:
        """Generate a mock JWT token"""
        import jwt
        return jwt.encode(payload, secret, algorithm='HS256')
    
    @staticmethod
    def generate_api_response(status_code: int, data: Any = None, message: str = None) -> Dict[str, Any]:
        """Generate a mock API response"""
        response = {
            'status_code': status_code,
            'success': 200 <= status_code < 300,
            'timestamp': datetime.now().isoformat()
        }
        
        if data is not None:
            response['data'] = data
        
        if message is not None:
            response['message'] = message
        elif 200 <= status_code < 300:
            response['message'] = 'Success'
        elif 400 <= status_code < 500:
            response['message'] = 'Client Error'
        else:
            response['message'] = 'Server Error'
        
        return response
    
    @staticmethod
    def generate_file_data(filename: str, content_type: str = None) -> bytes:
        """Generate mock file data"""
        if content_type is None:
            content_type = guess_extension(filename, default='application/octet-stream')
        
        if 'text' in content_type:
            return fake.paragraph(nb_sentences=10).encode('utf-8')
